'''Obli''' runs [[Obli's General Store]] in [[Shilo Village (location)|Shilo Village]]. His shop does not have the normal stock of a [[general store]], but rather has the same items available for purchase as [[Jiminua's Jungle Store]] in [[Tai Bwo Wannai]]. The price of items in the store change if the player wears [[Karamja gloves]].

